import { Link, Route, Routes } from 'react-router-dom';
import MyNavbar from '../../components/Navbar/Navbar';
import './Article.css'
import { Button } from 'react-bootstrap';
function Article(){
return(
    <>
    <MyNavbar/>
    <h1> صفحه مقالات</h1>
    <hr/>
    <Button variant="outline-info" className='mx-2'><Link to={'php'}>php article</Link></Button>
    <Button variant="outline-warning" className='mx-2'><Link to={'js'}>js article</Link></Button>
    <Button variant="outline-primary" className='mx-2'><Link to={'react'}>react article</Link></Button>
    <hr></hr>
    <Routes>
        <Route path='php' element={<h2>php article</h2>}/>
        <Route path='js' element={<h2>java script article</h2>}/>
        <Route path='react' element={<h2>react article</h2>}/>
    </Routes>
    </>
)
}
export default Article
